import React from "react";
import "../App.css";
import {SideBarData} from './SidebarData';

function Sidebar() {
    return (
    <div className= "SideBar">
        <ul>
        {SideBarData.map((val, key) => {
        return (<li key= {key}>
            {" "}
            <div> {val.icon} </div>
            <div> {val.title} </div>
        </li>);
          })}
        </ul>
        </div>
    );
}

export default Sidebar;
